#include <iostream>
#include <string>
#include <algorithm>
#include <vector>
#include <unordered_map>

using namespace std;

class Solution {
public:
    int numMatchingSubseq(string s, vector<string>& words){
        int result = words.size();
        unordered_map<char, vector<int>> umap;
        for(int i=0; i<s.size(); i++){
            umap[s[i]].push_back(i);
        }
        for(auto word:words){
            int now = -1;
            for(int i = 0; i<word.size();i++){
                    auto it = upper_bound(umap[word[i]].begin(), umap[word[i]].end(), now);
                    if(it != umap[word[i]].end())
                        now = *it;
                    else {
                        result--;
                        break;
                    }
            }
        }
        return result;
    }
};

